            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><div class=\"c6\">*** START OF THE PROJECT GUTENBERG EBOOK THE YELLOW WALLPAPER ***</div></div>"
