        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000010": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000010",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><h1>The Yellow Wallpaper</h1></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000011": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000011",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><h2>By Charlotte Perkins Gilman</h2></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000012": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000012",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\">\n\n</div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000013": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000013",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>It is very seldom that mere ordinary people like John and myself secure ancestral halls for the summer.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000014": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000014",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>A colonial mansion, a hereditary estate, I would say a haunted house, and reach the height of romantic felicity—but that would be asking too much of fate!</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000015": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000015",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>Still I will proudly declare that there is something queer about it.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000016": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000016",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>Else, why should it be let so cheaply? And why have stood so long untenanted?</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000017": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000017",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>John laughs at me, of course, but one expects that in marriage.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000018": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000018",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>John is practical in the extreme. He has no patience with faith, an intense horror of superstition, and he scoffs openly at any talk of things not to be felt and seen and put down in figures.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000019": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000019",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>John is a physician, and <i>perhaps</i>—(I would not say it to a living soul, of course, but this is dead paper and a great relief to my mind)—<i>perhaps</i> that is one reason I do not get well faster.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000020": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000020",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>You see, he does not believe I am sick!</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000021": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000021",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>And what can one do?</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000022": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000022",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>If a physician of high standing, and one’s own husband, assures friends and relatives that there is really nothing the matter with one but temporary nervous depression—a slight hysterical tendency—what is one to do?</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000023": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000023",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>My brother is also a physician, and also of high standing, and he says the same thing.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000024": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000024",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>So I take phosphates or phosphites—whichever it is, and tonics, and journeys, and air, and exercise, and am absolutely forbidden to “work” until I am well again.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000025": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000025",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>Personally, I disagree with their ideas.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000026": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000026",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>Personally, I believe that congenial work, with excitement and change, would do me good.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000027": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000027",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>But what is one to do?</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000028": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000028",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>I did write for a while in spite of them; but it <i>does</i> exhaust me a good deal—having to be so sly about it, or else meet with heavy opposition.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000029": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000029",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>I sometimes fancy that in my condition if I had less opposition and more society and stimulus—but John says the very worst thing I can do is to think about my condition, and I confess it always makes me feel bad.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000030": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000030",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>So I will let it alone and talk about the house.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000031": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000031",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>The most beautiful place! It is quite alone, standing well back from the road, quite three miles from the village. It makes me think of English places that you read about, for there are hedges and walls and gates that lock, and lots of separate little houses for the gardeners and people.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000032": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000032",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>There is a <i>delicious</i> garden! I never saw such a garden—large and shady, full of box-bordered paths, and lined with long grape-covered arbors with seats under them.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000033": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000033",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>There were greenhouses, too, but they are all broken now.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000034": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000034",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>There was some legal trouble, I believe, something about the heirs and co-heirs; anyhow, the place has been empty for years.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000035": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000035",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>That spoils my ghostliness, I am afraid; but I don’t care—there is something strange about the house—I can feel it.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000036": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000036",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>I even said so to John one moonlight evening, but he said what I felt was a <i>draught</i>, and shut the window.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000037": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000037",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>I get unreasonably angry with John sometimes. I’m sure I never used to be so sensitive. I think it is due to this nervous condition.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000038": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000038",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>But John says if I feel so I shall neglect proper self-control; so I take pains to control myself,—before him, at least,—and that makes me very tired.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000039": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000039",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>I don’t like our room a bit. I wanted one downstairs that opened on the piazza and had roses all over the window, and such pretty old-fashioned chintz hangings! but John would not hear of it.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000040": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000040",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>He said there was only one window and not room for two beds, and no near room for him if he took another.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000041": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000041",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>He is very careful and loving, and hardly lets me stir without special direction.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000042": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000042",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>I have a schedule prescription for each hour in the day; he takes all care from me, and so I feel basely ungrateful not to value it more.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000043": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000043",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>He said we came here solely on my account, that I was to have perfect rest and all the air I could get. “Your exercise depends on your strength, my dear,” said he, “and your food somewhat on your appetite; but air you can absorb all the time.” So we took the nursery, at the top of the house.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000044": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000044",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>It is a big, airy room, the whole floor nearly, with windows that look all ways, and air and sunshine galore. It was nursery first and then playground and gymnasium, I should judge; for the windows are barred for little children, and there are rings and things in the walls.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000045": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000045",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>The paint and paper look as if a boys’ school had used it. It is stripped off—the paper—in great patches all around the head of my bed, about as far as I can reach, and in a great place on the other side of the room low down. I never saw a worse paper in my life.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000046": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000046",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>One of those sprawling flamboyant patterns committing every artistic sin.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000047": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000047",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>It is dull enough to confuse the eye in following, pronounced enough to constantly irritate, and provoke study, and when you follow the lame, uncertain curves for a little distance they suddenly commit suicide—plunge off at outrageous angles, destroy themselves in unheard-of contradictions.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000048": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000048",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>The color is repellant, almost revolting; a smouldering, unclean yellow, strangely faded by the slow-turning sunlight.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000049": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000049",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>It is a dull yet lurid orange in some places, a sickly sulphur tint in others.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000050": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000050",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>No wonder the children hated it! I should hate it myself if I had to live in this room long.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000051": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000051",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>There comes John, and I must put this away,—he hates to have me write a word.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000052": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000052",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p class=\"p2\">We have been here two weeks, and I haven’t felt like writing before, since that first day.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000053": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000053",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>I am sitting by the window now, up in this atrocious nursery, and there is nothing to hinder my writing as much as I please, save lack of strength.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000054": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000054",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>John is away all day, and even some nights when his cases are serious.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000055": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000055",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>I am glad my case is not serious!</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000056": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000056",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>But these nervous troubles are dreadfully depressing.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000057": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000057",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>John does not know how much I really suffer. He knows there is no <i>reason</i> to suffer, and that satisfies him.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000058": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000058",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>Of course it is only nervousness. It does weigh on me so not to do my duty in any way!</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000059": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000059",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>I meant to be such a help to John, such a real rest and comfort, and here I am a comparative burden already!</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000060": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000060",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>Nobody would believe what an effort it is to do what little I am able—to dress and entertain, and order things.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000061": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000061",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>It is fortunate Mary is so good with the baby. Such a dear baby!</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000062": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000062",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>And yet I <i>cannot</i> be with him, it makes me so nervous.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000063": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000063",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>I suppose John never was nervous in his life. He laughs at me so about this wallpaper!</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000064": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000064",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>At first he meant to repaper the room, but afterwards he said that I was letting it get the better of me, and that nothing was worse for a nervous patient than to give way to such fancies.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000065": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000065",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>He said that after the wallpaper was changed it would be the heavy bedstead, and then the barred windows, and then that gate at the head of the stairs, and so on.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000066": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000066",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>“You know the place is doing you good,” he said, “and really, dear, I don’t care to renovate the house just for a three months’ rental.”</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000067": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000067",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>“Then do let us go downstairs,” I said, “there are such pretty rooms there.”</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000068": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000068",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>Then he took me in his arms and called me a blessed little goose, and said he would go down cellar if I wished, and have it whitewashed into the bargain.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000069": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000069",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>But he is right enough about the beds and windows and things.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000070": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000070",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>It is as airy and comfortable a room as any one need wish, and, of course, I would not be so silly as to make him uncomfortable just for a whim.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000071": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000071",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>I’m really getting quite fond of the big room, all but that horrid paper.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000072": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000072",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>Out of one window I can see the garden, those mysterious deep-shaded arbors, the riotous old-fashioned flowers, and bushes and gnarly trees.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000073": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000073",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>Out of another I get a lovely view of the bay and a little private wharf belonging to the estate. There is a beautiful shaded lane that runs down there from the house. I always fancy I see people walking in these numerous paths and arbors, but John has cautioned me not to give way to fancy in the least. He says that with my imaginative power and habit of story-making a nervous weakness like mine is sure to lead to all manner of excited fancies, and that I ought to use my will and good sense to check the tendency. So I try.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000074": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000074",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>I think sometimes that if I were only well enough to write a little it would relieve the press of ideas and rest me.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000075": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000075",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>But I find I get pretty tired when I try.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000076": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000076",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>It is so discouraging not to have any advice and companionship about my work. When I get really well John says we will ask Cousin Henry and Julia down for a long visit; but he says he would as soon put fire-works in my pillow-case as to let me have those stimulating people about now.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000077": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000077",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>I wish I could get well faster.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000078": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000078",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>But I must not think about that. This paper looks to me as if it <i>knew</i> what a vicious influence it had!</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000079": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000079",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>There is a recurrent spot where the pattern lolls like a broken neck and two bulbous eyes stare at you upside-down.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000080": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000080",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>I get positively angry with the impertinence of it and the everlastingness. Up and down and sideways they crawl, and those absurd, unblinking eyes are everywhere. There is one place where two breadths didn’t match, and the eyes go all up and down the line, one a little higher than the other.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000081": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000081",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>I never saw so much expression in an inanimate thing before, and we all know how much expression they have! I used to lie awake as a child and get more entertainment and terror out of blank walls and plain furniture than most children could find in a toy-store.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000082": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000082",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>I remember what a kindly wink the knobs of our big old bureau used to have, and there was one chair that always seemed like a strong friend.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000083": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000083",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>I used to feel that if any of the other things looked too fierce I could always hop into that chair and be safe.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000084": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000084",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>The furniture in this room is no worse than inharmonious, however, for we had to bring it all from downstairs. I suppose when this was used as a playroom they had to take the nursery things out, and no wonder! I never saw such ravages as the children have made here.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000085": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000085",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>The wallpaper, as I said before, is torn off in spots, and it sticketh closer than a brother—they must have had perseverance as well as hatred.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000086": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000086",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>Then the floor is scratched and gouged and splintered, the plaster itself is dug out here and there, and this great heavy bed, which is all we found in the room, looks as if it had been through the wars.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000087": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000087",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>But I don’t mind it a bit—only the paper.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000088": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000088",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>There comes John’s sister. Such a dear girl as she is, and so careful of me! I must not let her find me writing.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000089": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000089",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>She is a perfect, and enthusiastic housekeeper, and hopes for no better profession. I verily believe she thinks it is the writing which made me sick!</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000090": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000090",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>But I can write when she is out, and see her a long way off from these windows.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000091": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000091",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>There is one that commands the road, a lovely, shaded, winding road, and one that just looks off over the country. A lovely country, too, full of great elms and velvet meadows.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000092": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000092",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>This wallpaper has a kind of sub-pattern in a different shade, a particularly irritating one, for you can only see it in certain lights, and not clearly then.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000093": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000093",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>But in the places where it isn’t faded, and where the sun is just so, I can see a strange, provoking, formless sort of figure, that seems to sulk about behind that silly and conspicuous front design.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000094": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000094",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>There’s sister on the stairs!</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000095": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000095",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p class=\"p2\">Well, the Fourth of July is over! The people are gone and I am tired out. John thought it might do me good to see a little company, so we just had mother and Nellie and the children down for a week.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000096": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000096",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>Of course I didn’t do a thing. Jennie sees to everything now.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000097": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000097",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>But it tired me all the same.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000098": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000098",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>John says if I don’t pick up faster he shall send me to Weir Mitchell in the fall.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000099": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000099",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>But I don’t want to go there at all. I had a friend who was in his hands once, and she says he is just like John and my brother, only more so!</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000100": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000100",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>Besides, it is such an undertaking to go so far.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000101": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000101",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>I don’t feel as if it was worth while to turn my hand over for anything, and I’m getting dreadfully fretful and querulous.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000102": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000102",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>I cry at nothing, and cry most of the time.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000103": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000103",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>Of course I don’t when John is here, or anybody else, but when I am alone.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000104": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000104",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>And I am alone a good deal just now. John is kept in town very often by serious cases, and Jennie is good and lets me alone when I want her to.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000105": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000105",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>So I walk a little in the garden or down that lovely lane, sit on the porch under the roses, and lie down up here a good deal.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000106": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000106",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>I’m getting really fond of the room in spite of the wallpaper. Perhaps <i>because</i> of the wallpaper.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000107": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000107",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>It dwells in my mind so!</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000108": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000108",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>I lie here on this great immovable bed—it is nailed down, I believe—and follow that pattern about by the hour. It is as good as gymnastics, I assure you. I start, we’ll say, at the bottom, down in the corner over there where it has not been touched, and I determine for the thousandth time that I <i>will</i> follow that pointless pattern to some sort of a conclusion.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000109": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000109",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>I know a little of the principle of design, and I know this thing was not arranged on any laws of radiation, or alternation, or repetition, or symmetry, or anything else that I ever heard of.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000110": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000110",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>It is repeated, of course, by the breadths, but not otherwise.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000111": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000111",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>Looked at in one way each breadth stands alone, the bloated curves and flourishes—a kind of “debased Romanesque” with <i>delirium tremens</i>—go waddling up and down in isolated columns of fatuity.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000112": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000112",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>But, on the other hand, they connect diagonally, and the sprawling outlines run off in great slanting waves of optic horror, like a lot of wallowing seaweeds in full chase.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000113": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000113",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>The whole thing goes horizontally, too, at least it seems so, and I exhaust myself in trying to distinguish the order of its going in that direction.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000114": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000114",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>They have used a horizontal breadth for a frieze, and that adds wonderfully to the confusion.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000115": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000115",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>There is one end of the room where it is almost intact, and there, when the cross-lights fade and the low sun shines directly upon it, I can almost fancy radiation after all,—the interminable grotesques seem to form around a common centre and rush off in headlong plunges of equal distraction.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000116": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000116",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>It makes me tired to follow it. I will take a nap, I guess.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000117": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000117",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p class=\"p2\">I don’t know why I should write this.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000118": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000118",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>I don’t want to.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000119": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000119",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>I don’t feel able.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000120": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000120",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>And I know John would think it absurd. But I <i>must</i> say what I feel and think in some way—it is such a relief!</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000121": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000121",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>But the effort is getting to be greater than the relief.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000122": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000122",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>Half the time now I am awfully lazy, and lie down ever so much.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000123": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000123",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>John says I musn’t lose my strength, and has me take cod-liver oil and lots of tonics and things, to say nothing of ale and wine and rare meat.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000124": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000124",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>Dear John! He loves me very dearly, and hates to have me sick. I tried to have a real earnest reasonable talk with him the other day, and tell him how I wish he would let me go and make a visit to Cousin Henry and Julia.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000125": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000125",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>But he said I wasn’t able to go, nor able to stand it after I got there; and I did not make out a very good case for myself, for I was crying before I had finished.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000126": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000126",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>It is getting to be a great effort for me to think straight. Just this nervous weakness, I suppose.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000127": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000127",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>And dear John gathered me up in his arms, and just carried me upstairs and laid me on the bed, and sat by me and read to me till it tired my head.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000128": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000128",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>He said I was his darling and his comfort and all he had, and that I must take care of myself for his sake, and keep well.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000129": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000129",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>He says no one but myself can help me out of it, that I must use my will and self-control and not let any silly fancies run away with me.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000130": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000130",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>There’s one comfort, the baby is well and happy, and does not have to occupy this nursery with the horrid wallpaper.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000131": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000131",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>If we had not used it that blessed child would have! What a fortunate escape! Why, I wouldn’t have a child of mine, an impressionable little thing, live in such a room for worlds.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000132": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000132",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>I never thought of it before, but it is lucky that John kept me here after all. I can stand it so much easier than a baby, you see.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000133": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000133",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>Of course I never mention it to them any more,—I am too wise,—but I keep watch of it all the same.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000134": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000134",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>There are things in that paper that nobody knows but me, or ever will.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000135": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000135",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>Behind that outside pattern the dim shapes get clearer every day.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000136": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000136",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>It is always the same shape, only very numerous.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000137": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000137",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>And it is like a woman stooping down and creeping about behind that pattern. I don’t like it a bit. I wonder—I begin to think—I wish John would take me away from here!</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000138": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000138",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p class=\"p2\">It is so hard to talk with John about my case, because he is so wise, and because he loves me so.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000139": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000139",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>But I tried it last night.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000140": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000140",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>It was moonlight. The moon shines in all around, just as the sun does.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000141": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000141",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>I hate to see it sometimes, it creeps so slowly, and always comes in by one window or another.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000142": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000142",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>John was asleep and I hated to waken him, so I kept still and watched the moonlight on that undulating wallpaper till I felt creepy.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000143": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000143",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>The faint figure behind seemed to shake the pattern, just as if she wanted to get out.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000144": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000144",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>I got up softly and went to feel and see if the paper <i>did</i> move, and when I came back John was awake.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000145": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000145",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>“What is it, little girl?” he said. “Don’t go walking about like that—you’ll get cold.”</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000146": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000146",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>I thought it was a good time to talk, so I told him that I really was not gaining here, and that I wished he would take me away.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000147": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000147",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>“Why darling!” said he, “our lease will be up in three weeks, and I can’t see how to leave before.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000148": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000148",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>“The repairs are not done at home, and I cannot possibly leave town just now. Of course if you were in any danger I could and would, but you really are better, dear, whether you can see it or not. I am a doctor, dear, and I know. You are gaining flesh and color, your appetite is better. I feel really much easier about you.”</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000149": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000149",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>“I don’t weigh a bit more,” said I, “nor as much; and my appetite may be better in the evening, when you are here, but it is worse in the morning when you are away.”</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000150": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000150",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>“Bless her little heart!” said he with a big hug; “she shall be as sick as she pleases! But now let’s improve the shining hours by going to sleep, and talk about it in the morning!”</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000151": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000151",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>“And you won’t go away?” I asked gloomily.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000152": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000152",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>“Why, how can I, dear? It is only three weeks more and then we will take a nice little trip of a few days while Jennie is getting the house ready. Really, dear, you are better!”</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000153": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000153",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>“Better in body perhaps”—I began, and stopped short, for he sat up straight and looked at me with such a stern, reproachful look that I could not say another word.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000154": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000154",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>“My darling,” said he, “I beg of you, for my sake and for our child’s sake, as well as for your own, that you will never for one instant let that idea enter your mind! There is nothing so dangerous, so fascinating, to a temperament like yours. It is a false and foolish fancy. Can you not trust me as a physician when I tell you so?”</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000155": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000155",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>So of course I said no more on that score, and we went to sleep before long. He thought I was asleep first, but I wasn’t,—I lay there for hours trying to decide whether that front pattern and the back pattern really did move together or separately.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000156": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000156",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>On a pattern like this, by daylight, there is a lack of sequence, a defiance of law, that is a constant irritant to a normal mind.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000157": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000157",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>The color is hideous enough, and unreliable enough, and infuriating enough, but the pattern is torturing.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000158": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000158",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>You think you have mastered it, but just as you get well under way in following, it turns a back somersault and there you are. It slaps you in the face, knocks you down, and tramples upon you. It is like a bad dream.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000159": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000159",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>The outside pattern is a florid arabesque, reminding one of a fungus. If you can imagine a toadstool in joints, an interminable string of toadstools, budding and sprouting in endless convolutions,—why, that is something like it.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000160": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000160",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>That is, sometimes!</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000161": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000161",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>There is one marked peculiarity about this paper, a thing nobody seems to notice but myself, and that is that it changes as the light changes.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000162": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000162",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>When the sun shoots in through the east window—I always watch for that first long, straight ray—it changes so quickly that I never can quite believe it.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000163": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000163",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>That is why I watch it always.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000164": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000164",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>By moonlight—the moon shines in all night when there is a moon—I wouldn’t know it was the same paper.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000165": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000165",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>At night in any kind of light, in twilight, candlelight, lamplight, and worst of all by moonlight, it becomes bars! The outside pattern I mean, and the woman behind it is as plain as can be.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000166": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000166",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>I didn’t realize for a long time what the thing was that showed behind,—that dim sub-pattern,—but now I am quite sure it is a woman.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000167": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000167",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>By daylight she is subdued, quiet. I fancy it is the pattern that keeps her so still. It is so puzzling. It keeps me quiet by the hour.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000168": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000168",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>I lie down ever so much now. John says it is good for me, and to sleep all I can.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000169": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000169",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>Indeed, he started the habit by making me lie down for an hour after each meal.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000170": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000170",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>It is a very bad habit, I am convinced, for, you see, I don’t sleep.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000171": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000171",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>And that cultivates deceit, for I don’t tell them I’m awake,—oh, no!</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000172": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000172",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>The fact is, I am getting a little afraid of John.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000173": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000173",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>He seems very queer sometimes, and even Jennie has an inexplicable look.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000174": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000174",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>It strikes me occasionally, just as a scientific hypothesis, that perhaps it is the paper!</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000175": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000175",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>I have watched John when he did not know I was looking, and come into the room suddenly on the most innocent excuses, and I’ve caught him several times <i>looking at the paper!</i> And Jennie too. I caught Jennie with her hand on it once.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000176": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000176",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>She didn’t know I was in the room, and when I asked her in a quiet, a very quiet voice, with the most restrained manner possible, what she was doing with the paper she turned around as if she had been caught stealing, and looked quite angry—asked me why I should frighten her so!</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000177": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000177",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>Then she said that the paper stained everything it touched, that she had found yellow smooches on all my clothes and John’s, and she wished we would be more careful!</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000178": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000178",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>Did not that sound innocent? But I know she was studying that pattern, and I am determined that nobody shall find it out but myself!</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000179": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000179",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p class=\"p2\">Life is very much more exciting now than it used to be. You see I have something more to expect, to look forward to, to watch. I really do eat better, and am more quiet than I was.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000180": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000180",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>John is so pleased to see me improve! He laughed a little the other day, and said I seemed to be flourishing in spite of my wallpaper.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000181": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000181",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>I turned it off with a laugh. I had no intention of telling him it was <i>because</i> of the wallpaper—he would make fun of me. He might even want to take me away.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000182": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000182",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>I don’t want to leave now until I have found it out. There is a week more, and I think that will be enough.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000183": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000183",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p class=\"p2\">I’m feeling ever so much better! I don’t sleep much at night, for it is so interesting to watch developments; but I sleep a good deal in the daytime.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000184": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000184",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>In the daytime it is tiresome and perplexing.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000185": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000185",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>There are always new shoots on the fungus, and new shades of yellow all over it. I cannot keep count of them, though I have tried conscientiously.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000186": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000186",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>It is the strangest yellow, that wallpaper! It makes me think of all the yellow things I ever saw—not beautiful ones like buttercups, but old foul, bad yellow things.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000187": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000187",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>But there is something else about that paper—the smell! I noticed it the moment we came into the room, but with so much air and sun it was not bad. Now we have had a week of fog and rain, and whether the windows are open or not, the smell is here.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000188": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000188",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>It creeps all over the house.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000189": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000189",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>I find it hovering in the dining-room, skulking in the parlor, hiding in the hall, lying in wait for me on the stairs.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000190": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000190",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>It gets into my hair.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000191": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000191",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>Even when I go to ride, if I turn my head suddenly and surprise it—there is that smell!</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000192": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000192",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>Such a peculiar odor, too! I have spent hours in trying to analyze it, to find what it smelled like.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000193": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000193",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>It is not bad—at first, and very gentle, but quite the subtlest, most enduring odor I ever met.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000194": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000194",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>In this damp weather it is awful. I wake up in the night and find it hanging over me.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000195": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000195",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>It used to disturb me at first. I thought seriously of burning the house—to reach the smell.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000196": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000196",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>But now I am used to it. The only thing I can think of that it is like is the <i>color</i> of the paper! A yellow smell.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000197": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000197",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>There is a very funny mark on this wall, low down, near the mopboard. A streak that runs round the room. It goes behind every piece of furniture, except the bed, a long, straight, even <i>smooch</i>, as if it had been rubbed over and over.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000198": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000198",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>I wonder how it was done and who did it, and what they did it for. Round and round and round—round and round and round—it makes me dizzy!</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000199": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000199",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p class=\"p2\">I really have discovered something at last.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000200": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000200",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>Through watching so much at night, when it changes so, I have finally found out.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000201": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000201",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>The front pattern <i>does</i> move—and no wonder! The woman behind shakes it!</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000202": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000202",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>Sometimes I think there are a great many women behind, and sometimes only one, and she crawls around fast, and her crawling shakes it all over.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000203": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000203",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>Then in the very bright spots she keeps still, and in the very shady spots she just takes hold of the bars and shakes them hard.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000204": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000204",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>And she is all the time trying to climb through. But nobody could climb through that pattern—it strangles so; I think that is why it has so many heads.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000205": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000205",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>They get through, and then the pattern strangles them off and turns them upside-down, and makes their eyes white!</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000206": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000206",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>If those heads were covered or taken off it would not be half so bad.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000207": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000207",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p class=\"p2\">I think that woman gets out in the daytime!</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000208": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000208",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>And I’ll tell you why—privately—I’ve seen her!</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000209": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000209",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>I can see her out of every one of my windows!</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000210": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000210",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>It is the same woman, I know, for she is always creeping, and most women do not creep by daylight.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000211": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000211",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>I see her on that long shaded lane, creeping up and down. I see her in those dark grape arbors, creeping all around the garden.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000212": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000212",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>I see her on that long road under the trees, creeping along, and when a carriage comes she hides under the blackberry vines.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000213": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000213",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>I don’t blame her a bit. It must be very humiliating to be caught creeping by daylight!</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000214": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000214",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>I always lock the door when I creep by daylight. I can’t do it at night, for I know John would suspect something at once.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000215": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000215",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>And John is so queer now, that I don’t want to irritate him. I wish he would take another room! Besides, I don’t want anybody to get that woman out at night but myself.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000216": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000216",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>I often wonder if I could see her out of all the windows at once.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000217": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000217",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>But, turn as fast as I can, I can only see out of one at one time.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000218": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000218",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>And though I always see her she <i>may</i> be able to creep faster than I can turn!</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000219": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000219",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>I have watched her sometimes away off in the open country, creeping as fast as a cloud shadow in a high wind.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000220": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000220",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p class=\"p2\">If only that top pattern could be gotten off from the under one! I mean to try it, little by little.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000221": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000221",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>I have found out another funny thing, but I shan’t tell it this time! It does not do to trust people too much.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000222": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000222",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>There are only two more days to get this paper off, and I believe John is beginning to notice. I don’t like the look in his eyes.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000223": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000223",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>And I heard him ask Jennie a lot of professional questions about me. She had a very good report to give.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000224": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000224",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>She said I slept a good deal in the daytime.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000225": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000225",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>John knows I don’t sleep very well at night, for all I’m so quiet!</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000226": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000226",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>He asked me all sorts of questions, too, and pretended to be very loving and kind.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000227": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000227",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>As if I couldn’t see through him!</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000228": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000228",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>Still, I don’t wonder he acts so, sleeping under this paper for three months.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000229": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000229",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>It only interests me, but I feel sure John and Jennie are secretly affected by it.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000230": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000230",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p class=\"p2\">Hurrah! This is the last day, but it is enough. John is to stay in town over night, and won’t be out until this evening.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000231": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000231",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>Jennie wanted to sleep with me—the sly thing! but I told her I should undoubtedly rest better for a night all alone.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000232": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000232",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>That was clever, for really I wasn’t alone a bit! As soon as it was moonlight, and that poor thing began to crawl and shake the pattern, I got up and ran to help her.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000233": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000233",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>I pulled and she shook, I shook and she pulled, and before morning we had peeled off yards of that paper.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000234": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000234",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>A strip about as high as my head and half around the room.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000235": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000235",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>And then when the sun came and that awful pattern began to laugh at me I declared I would finish it to-day!</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000236": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000236",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>We go away to-morrow, and they are moving all my furniture down again to leave things as they were before.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000237": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000237",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>Jennie looked at the wall in amazement, but I told her merrily that I did it out of pure spite at the vicious thing.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000238": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000238",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>She laughed and said she wouldn’t mind doing it herself, but I must not get tired.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000239": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000239",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>How she betrayed herself that time!</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000240": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000240",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>But I am here, and no person touches this paper but me—not <i>alive!</i></p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000241": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000241",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>She tried to get me out of the room—it was too patent! But I said it was so quiet and empty and clean now that I believed I would lie down again and sleep all I could; and not to wake me even for dinner—I would call when I woke.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000242": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000242",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>So now she is gone, and the servants are gone, and the things are gone, and there is nothing left but that great bedstead nailed down, with the canvas mattress we found on it.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000243": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000243",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>We shall sleep downstairs to-night, and take the boat home to-morrow.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000244": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000244",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>I quite enjoy the room, now it is bare again.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000245": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000245",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>How those children did tear about here!</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000246": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000246",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>This bedstead is fairly gnawed!</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000247": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000247",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>But I must get to work.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000248": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000248",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>I have locked the door and thrown the key down into the front path.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000249": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000249",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>I don’t want to go out, and I don’t want to have anybody come in, till John comes.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000250": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000250",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>I want to astonish him.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000251": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000251",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>I’ve got a rope up here that even Jennie did not find. If that woman does get out, and tries to get away, I can tie her!</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000252": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000252",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>But I forgot I could not reach far without anything to stand on!</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000253": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000253",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>This bed will <i>not</i> move!</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000254": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000254",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>I tried to lift and push it until I was lame, and then I got so angry I bit off a little piece at one corner—but it hurt my teeth.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000255": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000255",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>Then I peeled off all the paper I could reach standing on the floor. It sticks horribly and the pattern just enjoys it! All those strangled heads and bulbous eyes and waddling fungus growths just shriek with derision!</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000256": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000256",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>I am getting angry enough to do something desperate. To jump out of the window would be admirable exercise, but the bars are too strong even to try.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000257": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000257",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>Besides I wouldn’t do it. Of course not. I know well enough that a step like that is improper and might be misconstrued.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000258": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000258",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>I don’t like to <i>look</i> out of the windows even—there are so many of those creeping women, and they creep so fast.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000259": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000259",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>I wonder if they all come out of that wallpaper as I did?</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000260": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000260",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>But I am securely fastened now by my well-hidden rope—you don’t get <i>me</i> out in the road there!</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000261": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000261",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>I suppose I shall have to get back behind the pattern when it comes night, and that is hard!</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000262": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000262",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>It is so pleasant to be out in this great room and creep around as I please!</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000263": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000263",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>I don’t want to go outside. I won’t, even if Jennie asks me to.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000264": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000264",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>For outside you have to creep on the ground, and everything is green instead of yellow.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000265": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000265",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>But here I can creep smoothly on the floor, and my shoulder just fits in that long smooch around the wall, so I cannot lose my way.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000266": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000266",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>Why, there’s John at the door!</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000267": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000267",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>It is no use, young man, you can’t open it!</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000268": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000268",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>How he does call and pound!</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000269": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000269",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>Now he’s crying for an axe.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000270": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000270",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>It would be a shame to break down that beautiful door!</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000271": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000271",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>“John dear!” said I in the gentlest voice, “the key is down by the front steps, under a plantain leaf!”</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000272": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000272",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>That silenced him for a few moments.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000273": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000273",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>Then he said—very quietly indeed, “Open the door, my darling!”</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000274": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000274",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>“I can’t,” said I. “The key is down by the front door under a plantain leaf!”</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000275": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000275",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>And then I said it again, several times, very gently and slowly, and said it so often that he had to go and see, and he got it, of course, and came in. He stopped short by the door.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000276": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000276",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>“What is the matter?” he cried. “For God’s sake, what are you doing!”</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000277": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000277",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>I kept on creeping just the same, but I looked at him over my shoulder.</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000278": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000278",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>“I’ve got out at last,” said I, “in spite of you and Jane! And I’ve pulled off most of the paper, so you can’t put me back!”</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000279": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000279",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><p>Now why should that man have fainted? But he did, and right across my path by the wall, so that I had to creep over him every time!</p></div>"
        },
        "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000280": {
            "role": "text",
            "title": "$:/plugins/twpub/ddf60ff3aaf612d1/text/000000280",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><div class=\"c9\">*** END OF THE PROJECT GUTENBERG EBOOK THE YELLOW WALLPAPER ***</div></div>"
        },
