            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><div class=\"c2\">Project Gutenberg™ is synonymous with the free distribution of electronic works in formats readable by the widest variety of computers including obsolete, old, middle-aged and new computers. It exists because of the efforts of hundreds of volunteers and donations from people in all walks of life.</div></div>"
