            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><div class=\"c2\">The Foundation is committed to complying with the laws regulating charities and charitable donations in all 50 states of the United States. Compliance requirements are not uniform and it takes a considerable effort, much paperwork and many fees to meet and keep up with these requirements. We do not solicit donations in locations where we have not received written confirmation of compliance. To SEND DONATIONS or determine the status of compliance for any particular state visit <a href=\"https://www.gutenberg.org/donate/\" rel=\"noopener noreferrer\" target=\"_blank\">www.gutenberg.org/donate</a>.</div></div>"
