            "text": "<div class=\"twpub-ddf60ff3aaf612d1-ed98ac twpub-ddf60ff3aaf612d1-337f6b twpub-ddf60ff3aaf612d1-6b4cd0\"><div class=\"c2\">Professor Michael S. Hart was the originator of the Project Gutenberg™ concept of a library of electronic works that could be freely shared with anyone. For forty years, he produced and distributed Project Gutenberg™ eBooks with only a loose network of volunteer support.</div></div>"
